import React from "react";
import "../styles/SideNav.css";

const SideNav = () => {
  return (
    <aside>
      <section>
        <h2 class="bigLetters">B</h2>
        <h3 class="firstName">Bastian</h3>
        <p class="profession">Web Developer</p>
      </section>
      <nav>
        <ul>
          <li>About</li>
          <li>My Skills</li>
          <li>Work</li>
          <li>Contact</li>
          <li>Blog</li>
          <li>Links</li>
        </ul>
      </nav>
    </aside>
  );
};

export default SideNav;
